import logo from './logo.svg';
import  Compteur  from './Clock';
import {Form} from './Form';
import './App.css';
import { Routes, Route} from "react-router-dom";

function App() {
  return <Routes>
    <Route path="/" element={<Form/>}/>
    <Route path="/clocks" element={<Compteur/>}/>
  </Routes>
}

export default App;
